    setCount(count+1)
  }

  let std=[
    {name:'james',age:21},
    {name:'david',age:22},
    {name:'stephen', age:23}
  ]
  return (
    <div className='App'>
      <button onClick={addCount}>Add</button>
      {
        std.map((obj,index)=>
          (
            <Students key={index} {...obj}/>
          )

        )
      }

    </div>
  )
      return
}



export default App;
